INSERT INTO `tweet` VALUES (1,'Que pedo con la gente que dice que #Sputnik no da sintomas? 10 am me la aplicaron, 5-6 hrs después me empecé a sentir rara y en este momento poco más de 12 hrs me siento de la fregada. Cuerpo cortado, temperatura, dolor de articulaciones, cabeza y brazo. #CDMX #VacunacionCDMX','https://twitter.com/_ale_rangel/status/1421339443919790080'),(2,'@ElRojoAbreu Solo un poco de sueño y el dolor en el brazo que era muy tolerable. En la primera dosis sí me fue muy mal.','https://twitter.com/_AndyMercado/status/1446669954716143619'),(3,'@GlodeJo07 Yo sólo tuve ligero dolor de cabeza y brazo,obviamente mi vacuna fue Aztra Zeneca....\r\nLas molestias secundarias en todo tipo de vacunas con virus atenuado son normales, lo sé ir hay que atender son las molestias persistentes o intensas...','https://twitter.com/_CarlosRN_/status/1378708552601251843'),(4,'@IngGonzaloCort2 Yo tengo ya las dos dósis de AztraZeneca y y las reacciones fueron prácticamente nulas a excepción de un ligero dolor de cabeza y brazo 12 hrs después de la primera dósis, la segunda 8 semanas después no tuve ninguna reacción... https://t.co/MJnQxVtcG8','https://twitter.com/_CarlosRN_/status/1408866347140984832'),(5,'#Sputnik 1 vs 0 Montse\r\n\r\nDolor de cuerpo incómodo que no me ha permitido dormir ni un minuto, leve dolor de cabeza ?. https://t.co/uWzIjMIa1R','https://twitter.com/_corazonafuego_/status/1417784043232546821'),(6,'Dear Sputnik:\r\n\r\nYa me chingaste el periodo, me diste fiebre y dolores de cabeza horribles... ¿Te faltará mucho para hacerme  crecer las bubis? ?????','https://twitter.com/_FanDango_/status/1440389217855500288'),(7,'Todo bien después de un día de la vacuna, poquito de dolor en el brazo pero ya todo cool ☺️','https://twitter.com/_lesyaa/status/1412904264352075781'),(8,'Los efectos de la vacuna me hicieron los mandados, pero, el dolor de cadera no, y no puedo tomar nada que no sea paracetamol. ?\r\nEntre cólicos, dolor de cabeza y dolor de cadera, neta, gana la cadera.','https://twitter.com/_nen_esq/status/1443742580995416068'),(9,'@ElyShuri También soy Dx y además me duele el brazo donde no me vacunaron xd','https://twitter.com/_unweynuevo/status/1420413334676033541'),(10,'@MaRiaNoiDe Son en varias , pero dicen que la más fuerte es la de Astra zeneca . A mí me dolor de cabeza muy fuerte al día siguiente , fui a entregar unas cosas por la mañana y en la tarde ya me sentía mal ☹️ .','https://twitter.com/11LOBO/status/1418003670705360896'),(11,'Amigos de 18 a 29 de la Benito Juárez de la letra S y rezagados, a ustedes también la vacuna los puso en estado postración 2 días? Voy por  mis 48 horas sintiéndome mal. \r\n\r\n38.9 de temperatura les parece correcto?\r\n\r\n38.9 de temperatura les parece correcto?','https://twitter.com/20l33lll58/status/1422141141344866304'),(12,'Creo que la vacuna sí redujo mi ciclo menstrual ?','https://twitter.com/8MYot9STkywA/status/1470523299407056902'),(13,'@doctormacias Todos las personas vacunadas con CanSino que conozco todas tuvieron síntomas como fiebre, dolor de cabeza, mareos e inclusive perdida de movimiento en el brazo o extremidades!!\r\nSi esta potente esa madre!','https://twitter.com/AbrahamTorres/status/1396266727692963841'),(14,'Buenos días @jrisco y @warkentin... \r\nAyer le tocó a mi hija mayor en Tlalpan su vacuna. Tardamos un poco en iniciar por la llegada del biológico, pero una vez que inició (8:45), fluyó rápido\r\nA Mer le dolió un poco el brazo todo el día y estuvo cansada\r\nFue a la escuela tras el ?','https://twitter.com/Abuelo_NFL/status/1541743118856474624'),(15,'@Odioyplantas El dolor de brazo. Pero no sé si es el de todos los días ó por la vacuna','https://twitter.com/actorjorgeleon/status/1482150966090735624'),(16,'@Dra_Crist @caballoloco54 @doctormacias La vacuna fue a las 9 y a las 6 de la tarde tuve 3 horas de calosfrios, dolor retro ocular, de espalda y fatiga extrema, a las 6 am me tome un paracetamol y todo desapareció. No me tome algo antes porque el médico que estaba ahí dijo que no','https://twitter.com/adelapoite/status/1370494192951173123'),(17,'48 hrs post vacuna covid. El dolor del brazo, ha desaparecido por completo! Y no he presentado absolutamente ningún síntoma ?. Al parecer la danza del RNA se lleva a cabo dentro de mis células, de manera pacífica y perfecta!!','https://twitter.com/AdolfoOcampoSma/status/1344780760633454594'),(18,'Y bueno, a 24 horas de haber recibido la vacuna, debo decirles que me duele mucho el brazo, a diferencia de la primera vez.... La neta, si duele, y bastante ? pero, OBVIO ese dolor es preferible 1000 veces, a contraer Covid-19 ?','https://twitter.com/AdolfoOcampoSma/status/1352986942066069506'),(19,'Destrozado por el viaje, recién vacunado y con horrible dolor de brazo pero se viene una semana divertida ?','https://twitter.com/ailoviutl/status/1509140491027337220'),(20,'Que padre Tatatiu que no te afecto tanto la Astra Zeneca, yo fui de los tantos que se sintió un poco mal al otro día y con dolor de brazo #PoderosoChapatatiu','https://twitter.com/aizamudio/status/1415693381477584899'),(21,'Siento que ya veo a San Pedro y me duele todo mi cuerpo. \r\n1.- ¿Será por la reacción de la vacuna?\r\n2.- ¿Será porque me tocó hacer pierna? \r\n???','https://twitter.com/ALDRIN_MCH/status/1496400548270067713'),(22,'En otras cosas, ayer fue mi segunda dosis de la vacuna contra la #COVIDー19 y me duele muchisimo el brazo, me siento cansado y con dolor de cabeza pero hay que ir a trabajar :( https://t.co/j1rn1Cwc6X','https://twitter.com/Alemaiden_666/status/1363893427319025674'),(23,'@doctormacias @EuniceRamd Dr., yo con la primera dosis de vacuna me sentí terriblemente, fiebre, pesadillas, parestesias generales, dolor en brazo como si me fuera a caer, fue una noche muy intensa, ¿ sugiere 2a dosis ?, agregado de que no hay certeza de la disponibilidad de esa 2a dosis','https://twitter.com/AleSomnologa/status/1356612218687807491'),(24,'Fiebre y pesadillas, el efecto Astra Zeneca ?','https://twitter.com/AleVillegas_11/status/1414235205095858176'),(25,'A 12 horas de la vacuna siento que mi brazo se me cae, me duele la cabeza y empiezo con un poco de fiebre ?\r\n\r\n#Vacunacion18a29\r\n#Coyoacán \r\n#Prepa5\r\n#VacunacionCDMX\r\n#SputnikV','https://twitter.com/AlexaCz/status/1443013470660833282'),(26,'Oigan qué lata eso de tener el periodo después de la vacuna. Llevo diez días de retraso con hartos cólicos y dolores por todos lados y nada de ná. Qué feo que seas así, Astra Zeneca, (¿Porque sí eres tú, verdad Astra Zeneca? ?)','https://twitter.com/AlinaDuarte_/status/1428484614620844040'),(27,'@Brendantares Bien, Bren. A mi padre le dio mucho sueño el día que le pusieron la vacuna y mi madre tuvo un poco de cuerpo cortado y dolor de cabeza, pero se le pasó al día siguiente. Ya le toca a tu má??','https://twitter.com/alinaeunice/status/1364089200501432320'),(28,'Pinche sueño monumental que traigo post vacuna, ayura.','https://twitter.com/Alitzelcamacho/status/1443693399211712518'),(29,'Solo tuve unas hora de fiebre con la #SputnikV todo el vodka que he ingerido en estos años acondicionó mi cuerpo para este momento.','https://twitter.com/AlmiranteMadrid/status/1419015326415704066'),(30,'@XanaTheMant Mis 3 dosis fueron Fáycer y pues sí, la dosis 3 me pegó bastante durito hoy. O sea, la 2a dosis estuvo de que fiebre pero poquito. Esta sí tuve fiebre y cansancio pero ignoro si fue porque vengo igual cansado af del viaje.','https://twitter.com/AlphXLang/status/1469868509412876288'),(31,'@ClaraBrugadaM @alc__Iztapalapa Mi estimada Lic. Brugada, ayúdanos también con el agua, como es posible que por un error de CFE dejen sin agua, afecta a mucha gente y hospitales, una reacción de la vacuna es temperatura recomiendan los baños tibios dicen los médicos pero como si no hay agua https://t.co/GOSQotRpGS','https://twitter.com/AlvaradoYazid/status/1411111357076885504'),(32,'Tumbado en cama, fiebre de 37.5, dolor de todo el cuerpo y cansancio.\r\n\r\nVacunados pero que mal la estamos pasando mi esposa y yo. \r\n\r\n#VacunaCOVID19 https://t.co/uXjaTV195O','https://twitter.com/amartinezdeleon/status/1413521010217865222'),(33,'@EmmelineLagunes @PabloVidalRibas @jonathanstea @Derektracy1 @AlfredoLopPce @DrKing_s @JRBneuropsiq @drlangosta @RyanMarino @psychunseen @MrTimDunn @Trickcyclist13 @amateuradam Hoy precisamente me vacunaron y lo único que siento es dolor en el brazo izquierdo!?!??????','https://twitter.com/amr_1971/status/1346642210394054656'),(34,'Personas menstruantes que ya recibieron la vacuna contra el Covid 19:\n\n¿Experimentaron algún cambio en su ciclo menstrual?\n\nTras la aplicación de la primera dosis de Sputnik V tuve un adelanto en mi periodo, y hoy tras un día de la segunda estoy teniendo SPM.','https://twitter.com/ana88julia/status/1438637159389540352'),(35,'En este artículo habla un poco al respecto, también sobre cómo han afectado otras vacunas al ciclo menstrual, pero aún no hay evidencia suficiente para saber si estas vacunas producen alteraciones, so... Aiuda.\r\n\r\nhttps://t.co/ngIlwcB4Wr','https://twitter.com/ana88julia/status/1438639275906580480'),(36,'Levanta la mano, cuanto tiempo despues de ponerse la vacuna pueden tomar paracetamol si les duele mucho la cabeza?','https://twitter.com/ANABELM5/status/1420438855837229060'),(37,'@tangeriineee Pues si es así, yo no me vacuné :( y nomás me duele el brazo a lo wey jajaja ya no quiero nada','https://twitter.com/aNaYork/status/1439824092505518083'),(38,'Yo, una pobre de Álvaro Obregón sin fecha para la primera dosis, escuchando a mis amigos quejarse del dolor de brazo porque ya les pusieron la segunda dosis de la vacuna. https://t.co/nrzqI6fBdi','https://twitter.com/Andrea_1596/status/1440871710312386567'),(39,'Updates de la ?… todo bien , solo dolor de brazo , un poco de cansancio y leve dolor de cabeza ?? esto nada comparable a mis migrañas ósea súper leve el asunto #SputnikV','https://twitter.com/Aniie_Blue13/status/1418989326885601281'),(40,'Ay ay\r\nNo hubo comentarios mios del partido Pumas vs America porque andaba con fiebre a tope cortesía de la 3ra dosis\r\nY de este Pumas vs Cruz Azul puees andaba en concierto con mis papis ?\r\n\r\nPero prometo verlos antes de la prox jornada para poner mis opiniones ?','https://twitter.com/Aniie_peke1326/status/1502917610282885120'),(41,'Pues no me dolió el brazo después de la vacuna #Pfizer de ayer, pero hoy amanecí cansada, como si hubiera hecho ejercicio y los músculos sensibles. \r\nNo me quiero mover... https://t.co/PTJDc5k3Ft','https://twitter.com/AnnaDelAire/status/1403076914391269378'),(42,'@mario_dico50 Yo tambien me la puse ayer, no tuve ninguna reacción solo un poco de dolor en el brazo, aclaro que el dolor inicio desde la primera vacuna','https://twitter.com/arcegama/status/1520140133315629056'),(43,'@maguislamas Pues me duele todo y tuve fiebre con el refuerzo , es cuestión de tiempo . Abrazos','https://twitter.com/Arceliayomerab1/status/1468563546644619269'),(44,'Me duele la cabeza y me vacuné hace dos meses ??','https://twitter.com/armgarci/status/1421570424475901952'),(45,'Y ayer finalmente le tocó su vacuna a mis críos: Sputnik para Coyoacán, no pude acompañarles al momento tan esperado, porque cero día a cuenta de vacaciones y vaya que lo necesitaba, cayeron en cama desde la tarde y hemos pasado mala noche, fiebre de 40.1° para un crío       1/2','https://twitter.com/Artomi_Mx/status/1443589083377192970'),(46,'Soy yo, o la segunda dosis de Sputnik está fuerte?\r\n\r\nLes juro que desde que me vacune me siento más cansada de lo habitual.','https://twitter.com/AshiaTeve/status/1441224416457740291'),(47,'Actualización 9:30pm(11hrs 30 minutos después de la vacuna) \r\nBanda tengo escalofríos y mucho frío, me duelen los ojos y siento el cuerpo cortado :\'v https://t.co/5PRtnPLcbu','https://twitter.com/AstroTopBoy/status/1421297278279720960'),(48,'Odio que me duela la cabeza!! Preferiría mil veces que me diera fiebre ?? te odio segunda dosis! ???','https://twitter.com/auu_ri/status/1449096612668641298'),(49,'Con dolor de cabeza por la vacuna pero con actitud de salir ??✌️ https://t.co/kXkkRJjXdL','https://twitter.com/AzullCielito16/status/1518293889232384000'),(50,'mi mamá fue sujeto prueba para la vacuna del covid, pero como es con estudio de doble ciego no puedes saber si te pusieron la verdadera o puro placebo \n\ntonces hoy en la mañana me dice bien feliz “desperté con dolor de cabeza, ojalá si sea la vacuna” XDDD JAJAJ','https://twitter.com/baebybatuwu/status/1341964176059731969'),(51,'Ayer en una reunión virtual una persona entro tarde se disculpo y nos comenta que la acababan de vacunar y que tenía fiebre pero que ya estaba con toda la disposición ??‍♀️ fui la única que le puse en el chat \"vete a descansar\".','https://twitter.com/beatricedeux/status/1481984224571891713'),(52,'13 Horas 10 minutos POSTVACUNA COVID \r\n\r\nCuerpo cortado, ligero dolor de cabeza y mucha fatiga\r\n\r\n#VacunaCOVID19 #AstraZeneca @SimpsonitoMX https://t.co/TKzK9kCqi4','https://twitter.com/blind__r9/status/1415148095663341576'),(53,'@GabrielaProyec3 @RinaVirtual Fíjate que a mí ninguna me hizo nada ?\r\nSi mucho, con el refuerzo de la Sputnik medio me dio un poco de fiebre (como 38 a lo mucho) por un ratito ?\r\nYo creo que los que andaban vacunando han puesto mas inyecciones que en toda su carrera y ya tienen mano de pluma ?','https://twitter.com/blzb_fallen_666/status/1564430859914158080'),(54,'@CaymanMexico @BicireporteraDF A mi me vacunaron con la de Astra y todo súper, solo el dolor del brazo','https://twitter.com/bnlora/status/1412484378253484034'),(55,'Update de mi vacuna: ?\nMe duele el brazo OGT, cuerpo cortado, leve dolor de cabeza y ayer en la noche me dio temperatura y unos escalofríos súper raros ??\n¡¡Hoy no estoy para nadie!!! \nTodo mundo me dijo que la segunda dosis es la que te pones peor, KEMIEDO','https://twitter.com/BonRodrigo/status/1412791000569987072'),(56,'@pbcfoto @ShomerDani @SSalud_mx A algunas personas les da efectos,a mi mamá le dio cansancio extremo en la primera dosis de Pfizer (Tlalpan) y a mi papá nada en la primer dosis. A ambos,en la segunda dosis no les pasó nada,solo dolor de brazo muy leve. Pero la gente prefiere morir de Covid que una simple vacuna','https://twitter.com/Braulio18251275/status/1412743976319340553'),(57,'Ya me vacunaron ? me tocó #CanSino  solo sentí un sabor raro en la garganta y nariz y un leve dolor de cabeza, a esperar las 72 horas \r\n#VacunaCOVID19\r\n#VacunacionCDMX #Vacunacionpersonaleducativo\r\n#maestravacunada \r\n#chip5G https://t.co/TOVDwEk9h5','https://twitter.com/bren_rosas/status/1395802835074355205'),(58,'@DrChavezDiaz @COFEPRIS Esto ya habian dicho d la 2a dosis a los 6 meses, casi sin efectos secundarios a mí me duró el dolor de cabeza 5 días, cuerpo 3 días, dolor de estómago, náuseas, a mis hermanos les tocó Astra Zeneca en Iztapalapa Población 30-39 años como si nada, mos papás Sputnik y sin efectos','https://twitter.com/bren_rosas/status/1424588282806026244'),(59,'Por cierto , si si, ya tengo el refuerzo #3Dosis \n? \nTodo bien, fuera de malestar en las articulaciones, un poco de dolor de cabeza y sha. ??','https://twitter.com/BrenLizardi/status/1489639910084685827'),(60,'Ayer me puse la vacuna Cansino, todo chingón, sin ninguna molestia hasta el momento. Sólo tengo un punche antojo de una sopa de murciélago y unos tacos de perro, acompañados de unas ratas empanizadas. Ah, y un chingo de sueño...','https://twitter.com/Bukowskierrante/status/1395704338362904579'),(61,'Casi 18 horas después de la vacuna ahora sí ya valió madres. Tengo dolor de cuerpo, frío y la cabeza me empieza a doler. Una cosa que me está pasando es que inconscientemente empiezo a tararear La Internacional!!!','https://twitter.com/Bukowskierrante/status/1395748349173800962'),(62,'Solo para puntualizar. Una semana dure con los efectos colaterales de la vacuna cansino. Hasta el viernes pasado andaba kalakas, con mucho sueño y cansancio!!!','https://twitter.co